  true,\n\t\"url\": null,\n\t\"notes\": \"The NASA IceBridge HiCARS 1 Level-0 Raw
  Return Energy Amplitudes data set contains radar sounder measurements taken over
  Antarctica using the Hi-Capability Radar Sounder (HiCARS) Version 1 instrument.
  The data were collected by scientists working on the Investigating the Cryospheric
  Evolution of the Central Antarctic Plate (ICECAP) project, which is funded by the
  National Science Foundation (NSF) and the Natural Environment Research Council (NERC)
  with additional support from NASA Operation IceBridge.  Data files are stored in
  binary format and ASCII text format and are available for periodic, ongoing campaigns
  from 2009 to the present via FTP.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
